import React from 'react';
import Pagination from '@mui/material/Pagination';
import { Box } from '@mui/material';

const Footer = () => {
  return (
    <Pagination
      count={10}
      variant="outlined"
      shape="rounded"
      style={{ position: 'fixed', bottom: 0, width: '100%' }}
    />
  );
};

export default Footer;
